import React from "react";
import axios from 'axios';
import { useDispatch, useSelector } from 'react-redux';
const Pagination = () => {
    const [page, setpage] = React.useState(2);
    const dispatch = useDispatch();
    React.useEffect(() => {
        axios.get('http://localhost:5000/getpage').then(function (response) {
           setpage({})

        })
            .catch(function (error) {

                console.log('Loi ' + error);
            });
    }, []);
    const callApi = (page) => {
      
        axios.get('http://localhost:5000/getdata/' + page).then(function (response) {
            dispatch({ type: 'DanhSachCayCanh', data: response.data });
        })
            .catch(function (error) {

                console.log('Loi ' + error);
            });
    }
    return (
        <div>
            <nav aria-label="Page navigation example">
                <ul className="pagination">
                    <li className="page-item">
                        <button type="button" className="page-link" onClick={() => {
                            page > 1 ? setpage(page - 1) : setpage(2);
                            callApi(page);
                        } } aria-label="Previous">
                            <span aria-hidden="true">«</span>
                            <span className="sr-only">Previous</span>
                        </button>
                    </li>
                    {
                        page.forEach(el => {
                            return(
                                <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(1)}>1</button></li>
                            );
                        })
                    }
                    <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(1)}>1</button></li>
                    <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(2)}>2</button></li>
                    <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(3)}>3</button></li>
                    <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(4)}>4</button></li>
                    <li className="page-item"><button type="button" class="btn page-link" onClick={() => callApi(5)}>5</button></li>
                    <li className="page-item">
                        <button type="button" className="page-link" onClick={() => {
                            setpage(page+1);
                            callApi(page);
                        }}  aria-label="Next">
                            <span aria-hidden="true">»</span>
                            <span className="sr-only">Next</span>
                        </button>
                    </li>
                </ul>
            </nav>
        </div>
    );
}
export default Pagination;
